    };

    const addDoctor = (e) => {
        e.preventDefault();
        // store.dispatch({ type: "ADD", playName: localState2.nAdd, playAge: localState2.aAdd, playAwards: localState2.awAdd })
        props.addDoctor(localState);
    }

    return (
        <div>Hello Welcome to doctors page
            <form style={{ border: "1px solid blue ", textAlign: "center" }}>
                <h3>Fill the details to add Doctor</h3>
                <label>Doctor Number:<input type="text" /></label><br />
                <label>Name:<input type="text" /></label><br />
                <label>Qualification:<input type="text" /></label><br />
